file:
- statement:
  - create_function_statement:
    - keyword: CREATE
    - keyword: TEMP
    - keyword: FUNCTION
    - function_name:
      - function_name_identifier: _qs
    - function_parameter_list:
      - bracketed:
        - start_bracket: (
        - parameter: y
        - data_type:
          - '': STRING
        - end_bracket: )
    - keyword: RETURNS
    - data_type:
      - struct_type:
        - keyword: STRUCT
        - struct_type_schema:
          - remove me: <
          - parameter: _product_id
          - data_type:
            - array_type:
              - keyword: ARRAY
              - remove me: <
              - data_type:
                - '': INT64
              - remove me: '>'
          - remove me: '>'
    - function_definition:
      - keyword: LANGUAGE
      - naked_identifier: js
      - keyword: AS
      - numeric_literal: '""'
- unparsable:
  - double_quote: |-
      "
          CODE GOES HERE
      "
  - double_quote: '""'
